	    addModelData: function addModelData(data, cb) {
	        var p = this;
	        for (var i in data) {
	            p.modelsData.push(data[i]);
	        }
	        cb();
	    },

	    addModel: function addModel(cb) {
	        var p = this;
	        var floors = [];
	        var modelLoadSuccessCount = 0;
	        var loadTime = 0;
	        for (var i in p.modelsData) {
	            var thisModel = p.modelsData[i];
	            p.loadObj(thisModel, function (mesh, success) {
	                if (success) {
	                    if (thisModel.typ == "floor") {
	                        var hasSelected = false;
	                        if (mesh.hasOwnProperty("material")) {
	                            hasSelected = mesh.material.opacity > 0.5 ? true : false;
	                        }
	                        floors.push({
	                            id: thisModel.floorid,
	                            floor: thisModel.floor,
	                            hasSelected: hasSelected
	                        });
	                    }
	                    modelLoadSuccessCount++;
	                } else {
	                    alert("加载模型失败:" + thisModel);
	                }
	            });
	        }
	        var ifContinueLoad = p.modelContinueLoad = setInterval(function () {
	            if (modelLoadSuccessCount == p.modelsData.length) {
	                cb(floors);
	                clearInterval(ifContinueLoad);
	                p.modelContinueLoad = 0;
	            } else {
	                loadTime += 100;
	                if (loadTime > 100 * 100) {
	                    alert("加载模型失败");
	                    clearInterval(ifContinueLoad);
	                }
	            }
	        }, 100);
	    },

	    loadObj: function loadObj(thisModel, cb) {
	        var p = this;
	        var loader = new THREE.ObjectLoader();
	        if (thisModel.floorid && !p.modelsByFloor[thisModel.floorid]) {
	            p.modelsByFloor[thisModel.floorid] = { /**********初始化modelsByFloor************/
	                floor: [],
	                area: []
	            };
	        }
	        if (thisModel.typ == "floor") {
	            //楼层模型
	            var floor = parseInt(thisModel.floor);
	            if ((floor == -1 || floor == 1) && !p.nowFloor.hasDefultFloor) {
	                /**********初始化nowFloor************/
	                p.nowFloor.floor = floor;
	                p.nowFloor.floorid = thisModel.floorid;
	                if (floor == 1) {
	                    p.nowFloor.hasDefultFloor = true;
	                }
	            }
	            var object = JSON.parse(thisModel.modelurl);
	            var mesh = loader.parse(object);
	            mesh.material.map.needsUpdate = true;
	            mesh.typ = "floor";
	            mesh.powerid = "floor_";
	            if (thisModel.floorid) {
	                //添加模型能耗获取所用的id
	                mesh.powerid = mesh.powerid + thisModel.floorid;
	            }

	            p.scene.add(mesh);
	            p.modelsByFloor[thisModel.floorid]["floor"].push(mesh);
	            cb(mesh, true);
	        }
	        if (thisModel.typ == "area") {
	            //区域模型
	            if (thisModel.modelurl) {
	                //有模型JSON的
	                var object = JSON.parse(thisModel.modelurl);
	                var mesh = loader.parse(object);
	                mesh.material.map = p.textures["area_" + thisModel.imageurl];
	                mesh.material.map.needsUpdate = true;

	                mesh.typ = "area"; //添加模型所表现类型
	                mesh.powerid = "area_";
	                if (thisModel.areaid) {
	                    //添加模型能耗获取所用的id
	                    mesh.powerid = mesh.powerid + thisModel.areaid;
	                }

	                p.scene.add(mesh);
	                p.modelsByFloor[thisModel.floorid]["area"].push(mesh);

	                if (thisModel.areaname && thisModel.areaname != "") {
	                    p.addAreaName(mesh.position, thisModel.areaname);
	                }

	                cb(mesh, true);
	            } else {
	                //没有模型JSON的
	                console.log(thisModel);
	                var thisPosition = thisModel.position.split(",");
	                if (thisPosition.length == 3) {
	                    var modelObj = {
	                        typ: "area",
	                        powerid: "area_",
	                        position: {
	                            x: parseFloat(parseFloat(thisPosition[0]).toFixed(2)),
	                            y: parseFloat(parseFloat(thisPosition[1]).toFixed(2)),
	                            z: parseFloat(parseFloat(thisPosition[2]).toFixed(2))
	                        }
	                    };
	                    if (thisModel.areaid) {
	                        //添加模型能耗获取所用的id
	                        modelObj.powerid = modelObj.powerid + thisModel.areaid;
	                    }

	                    p.modelsByFloor[thisModel.floorid]["area"].push(modelObj);

	                    if (thisModel.areaname && thisModel.areaname != "") {
	                        p.addAreaName(modelObj.position, thisModel.areaname);
	                    }

	                    cb(modelObj, true);
	                }
	            }
	        }
	    },

	    initAreaCanvas: function initAreaCanvas() {
	        var p = this;
	        var areaSize = 1024;
	        var areaType = p.state.theme.areaType;
	        for (var i in areaType) {
	            var canvas = document.createElement('canvas');
	            document.body.appendChild(canvas);
	            canvas.id = "area_" + i;
	            canvas.width = areaSize;
	            canvas.height = areaSize;
	            canvas.style.position = "absolute";
	            canvas.style.display = "none";
	            var context = canvas.getContext('2d');
	            context.beginPath();
	            var grd = context.createLinearGradient(0, 0, areaSize, areaSize);
	            grd.addColorStop(0, areaType[i].color[0]);
	            grd.addColorStop(1, areaType[i].color[1]);

	            context.fillStyle = grd;
	            context.fillRect(0, 0, areaSize, areaSize);

	            var thisTexture = new THREE.Texture(canvas);
	            p.textures["area_" + i] = thisTexture;
	            thisTexture.wrapS = 1001;
	            thisTexture.wrapT = 1001;
	            thisTexture.repeat.set(1, 1);
	            thisTexture.needsUpdate = true;
	        }
	    },

	    autoChangeAreaNum: 0,
	    autoChangeArea: function autoChangeArea() {
	        var p = this;
	        p.autoChangeAreaNum = setInterval(function () {
	            if (p.modelsByFloor[p.nowFloor.floorid] && p.modelsByFloor[p.nowFloor.floorid].area) {
	                var areaModels = p.modelsByFloor[p.nowFloor.floorid].area;
	                var areaNum = p.nowArea.area;
	                if (areaNum < areaModels.length - 1) {
	                    p.nowArea.area = areaNum + 1;
	                    p.nowArea.areaid = areaModels[p.nowArea.area].powerid.split("_")[1];
	                } else {
	                    p.nowArea.area = 0;
	                    p.nowArea.areaid = areaModels[0].powerid.split("_")[1];
	                }
	            }
	        }, 10 * 1000);
	    },

	    getModelPosition: function getModelPosition(cb) {
	        //object世界坐标转二维坐标
	        var p = this;
	        var result = {};
	        if (p.modelsByFloor[p.nowFloor.floorid] && p.modelsByFloor[p.nowFloor.floorid].area && p.scene && p.camera) {
	            var areaModels = p.modelsByFloor[p.nowFloor.floorid].area;
	            var mesh = areaModels[p.nowArea.area];
	            //console.log("$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$44");
	            //console.log(mesh.position.x);
	            //console.log(mesh.position.y);
	            //console.log(mesh.position.z);
	            //console.log("$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$44");
	            var projector = new THREE.Vector3(mesh.position.x, mesh.position.y + p.scene.position.y, mesh.position.z);
	            var vector = projector.project(p.camera);
	            var halfWidth = p.state.width / 2;
	            var halfHeight = p.state.height / 2;
	            result = {
	                x: Math.round(vector.x * halfWidth + halfWidth),
	                y: Math.round(-vector.y * halfHeight + halfHeight)
	            };
	            cb(result);
	        } else {
	            cb(result);
	        }
	    },

